import React, { Component } from "react";

export default class Banner extends Component {
  render() {
    return (
      <div style={{ display: "flex", height:"1000px" }}>
        <div
          style={{
            backgroundColor: "yellow",
          
            // width: "25%",
            border: "1px solid gray",
          }}
        ></div>
        <div
          style={{
            backgroundColor: "blue",
            width: "25%",
            border: "1px solid gray",
          }}
        >
        </div>
        <div
          style={{
            backgroundColor: "red",
            width: "25%",
            border: "1px solid gray",
          }}
        ></div>
        <div
          style={{
            backgroundColor: "green",
            width: "25%",
            border: "1px solid gray",
          }}
        ></div>
      </div>
    );
  }
}
